import './SubNavigation.css'
import React from 'react';
import SearchBar from '../SearchBar/Search';
import CreateProductForm from '../ProductForm/CreateProductForm';
import OpenModalButton from "../OpenModalButton";
const SubNavigation = () => {





    return (
        <>
      <SearchBar/>

      <OpenModalButton

      className="nav-form"
     modalComponent={<CreateProductForm/>}
    buttonText="List My Product"
     />

    <button className="cartButton">
      <img
        src="https://static.vecteezy.com/system/resources/previews/019/787/018/original/shopping-cart-icon-shopping-basket-on-transparent-background-free-png.png"
        alt="Shopping Cart"
        className="cartIcon"
      />
    </button>

        </>
    )
}


export default SubNavigation;
